import React, { useState, useEffect } from 'react';
import styles from './UserWorkouts.module.css'; 
import api from '../api';
import { Button, ModalBody, ModalHeader } from 'react-bootstrap';
import { Modal } from 'react-bootstrap';

const UserWorkouts = () => {
  const [workouts, setWorkouts] = useState([]);
  const [modal, setModalState] = useState(false);
  const [updWorkout, setUpdWorkout] = useState({
    title: '',
    description: '',
    date: ''
  })
  const [updState, setUpdState] = useState(false);
  

  useEffect(() => {
    const fetchUserWorkouts = async () => {
      try {
        const response = await api.get('/user/get/workouts');
        setWorkouts(response.data.workouts);
      } catch (error) {
        console.error('Error fetching user workouts:', error);
      }
    };

    fetchUserWorkouts();
  }, []); 

  const handleChange = (e) => {
    setUpdWorkout({ ...updWorkout, [e.target.name]: e.target.value });
  };
  const handleDelete = async (workoutId) => {
    try {
      await api.delete(`/workouts/${workoutId}`);
      setWorkouts(prevWorkouts => prevWorkouts.filter(workout => workout.id !== workoutId));
      console.log('Successfully deleted workout', workoutId);
      setModalState(true);
    } catch (error) {
      console.error('Error deleting workout:', error);
    }
  };
  const handleUpdate = async (workoutId) => {
    
    await api.put(`/workouts/${workoutId}`);
    setUpdState(true);


  }
  return (
    <div>
      <div className={styles.container}>
      <h2 className={styles.title}>All Users' Workouts</h2>
      {Array.isArray(workouts) &&
        workouts.map((workout) => (
          <div key={workout.id} className={styles.workoutCard}>
            <h3>{workout.title}</h3>
            <p>{workout.date}</p>
            <Button type='button' onClick={() => handleDelete(workout.id)}>Delete</Button>
            <Button type='button' onClick={() => handleUpdate(workout.id)}>Update workout</Button>
          </div>
        ))}
    </div>
    {updState && (
       <div className="container mt-5">
       <form>
         <div className="mb-3">
           <label htmlFor="title" className="form-label">
             Title
           </label>
           <input
             type="text"
             className="form-control"
             id="title"
             name="title"
             value={updWorkout.title}
             onChange={handleChange}
           />
         </div>
         <div className="mb-3">
           <label htmlFor="description" className="form-label">
             Description
           </label>
           <input
             type="text"
             className="form-control"
             id="description"
             name="description"
             value={updWorkout.description}
             onChange={handleChange}
           />
         </div>
         <div className="mb-3">
           <label htmlFor="date" className="form-label">
             Date
           </label>
           <input
             type="text"
             className="form-control"
             id="date"
             name="date"
             value={updWorkout.date}
             onChange={handleChange}
           />
         </div>
 
         <button type="submit" className="btn btn-primary" onClick={handleSubmit}>
           Update workout
         </button>
       </form>
     </div>

    )}
    {modal && (
        <Modal show={modal}>
        <ModalHeader>Deleted Workout
        <Button onClick={() => setModalState(false)}>Close</Button>
        </ModalHeader>
        <ModalBody>
          <p>Successfully deleted workout</p>
          
        </ModalBody>
       </Modal>

    )}
   
    </div>
    
  );
 
};

export default UserWorkouts;
